import React from 'react';
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css'; // Import Owl Carousel CSS

const CitiesListSlider = () => {
  const options = {
    items: 3,
    loop: true,
    nav: true,
  };

  return (
    <OwlCarousel className="owl-theme" {...options}>
      <div className="item"><h4>1</h4></div>
      <div className="item"><h4>2</h4></div>
      <div className="item"><h4>3</h4></div>
      <div className="item"><h4>4</h4></div>
      <div className="item"><h4>5</h4></div>
      <div className="item"><h4>6</h4></div>
    </OwlCarousel>
  );
}

export default CitiesListSlider;
